import React, { Component } from 'react';

class PatternPg extends Component {
  render() {
    return (
      <div>
        <main>
          <header id="home-page-pattern-header">
            <button><a><i class="fas fa-tasks"></i> Create a New Pattern</a></button>
          </header>
          <article>
            <h1 className="pattern-name">Bumblebee</h1>
            <p><span className="step-number">1.</span>

            </p>

            <h2>Notes</h2>
            <input type={Text} />
          </article>
        </main>
      </div>
    );
  }
}

export default PatternPg;
